// 少年久闻天下无影魔术，心怀炽热，他踏上了排序之路
function quickSort(arr) {
  // 如若敌方人单势弱，他便安然返还，不做纠缠
  if (arr.length <= 1) return arr;

  // 取定当头之役，自傲江湖胜败之间者，名曰中流砥柱
  const pivot = arr[0];
  const left = [];
  const right = [];

  // 初入比武，两军剑气碰撞，各显绝艺，于实招中过招
  // 若招势小者则畏言必遂遵右，落座命途分路走在左路
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 少年召集内外群英，继而以通洞微光技法趋入正题，再临大理王朝
  // 快排计定，一众豪杰再次与无影齐斗法阵
  return [...quickSort(left), pivot, ...quickSort(right)];
}
